<!--CAROUSEL-->  
<div class="container theme-showcase" role="main">


<br /><br /><br />

<div id="carousel-example-generic" class="carousel slide" data-ride="carousel">
    <div data-example-id="simple-carousel" class="bs-example">
        <div data-ride="carousel" class="carousel slide" id="carousel-example-generic">
          <ol class="carousel-indicators">
            <li class="" data-slide-to="0" data-target="#carousel-example-generic"></li>
            <li data-slide-to="1" data-target="#carousel-example-generic" class=""></li>
            <li data-slide-to="2" data-target="#carousel-example-generic" class="active"></li>
          </ol>
          <div role="listbox" class="carousel-inner">
            <div class="item">
              <img alt="First slide [900x500]" data-src="holder.js/1150x550/auto/#777:#555/text:First slide" src="data:image/svg+xml;base64," data-holder-rendered="true">
            </div>
            <div class="item">
              <img alt="Second slide [900x500]" data-src="holder.js/1150x550/auto/#666:#444/text:Second slide" src="data:image/svg+xml;base64," data-holder-rendered="true">
            </div>
            <div class="item active">
              <img alt="Third slide [900x500]" data-src="holder.js/1150x550/auto/#555:#333/text:Third slide" src="data:image/svg+xml;base64," data-holder-rendered="true">
            </div>
          </div>
          <a data-slide="prev" role="button" href="#carousel-example-generic" class="left carousel-control">
            <span aria-hidden="true" class="glyphicon glyphicon-chevron-left"></span>
            <span class="sr-only">Previous</span>
          </a>
          <a data-slide="next" role="button" href="#carousel-example-generic" class="right carousel-control">
            <span aria-hidden="true" class="glyphicon glyphicon-chevron-right"></span>
            <span class="sr-only">Next</span>
          </a>
        </div>
    </div>

</div>
